import React, { Component } from 'react';


class ProfileUI extends Component {
    // constructor() {
    //     super()
    // }
    render() {
        return (
            <table className="profile">
                <tr>
                    <td>
                        <img className="img" src="https://via.placeholder.com/730x400.png?text=Profile+Image+goes+here" alt="shit"></img>
                    </td>
                    <td>
                        <h1>Character Name goes here</h1>
                        <p>Biogrophy, or some shit</p>
                    </td>
                </tr>
                <tr className="comics">
                    <ComicList />
                </tr>
            </table>
        );
    };
}

export default ProfileUI;
